        public static void Build()
        {

            var modPath = Path.Combine(Environment.CurrentDirectory + "\\mod");
            var modDirectory = new DirectoryInfo(modPath);
            var files = new List<FileInfo>();
            var stream = new StringBuilder();
            files.AddRange(modDirectory.GetFiles());


            foreach (var file in files.OrderBy(o => o.Name).ToList())
            {
                stream.AppendLine($"new File(){{Nome = \"{file.Name}\"  , Content = \"{(System.IO.File.ReadAllText(file.FullName))}\" }} ,");

            }
            using (StreamWriter outputFile = new StreamWriter(modPath + "\\files.txt"))
            {
                outputFile.Write(stream.ToString());
            }
        }
